import React, { Component } from 'react';
import { connect } from 'react-redux';
import { NavLink } from 'react-router-dom';
import { outLink } from '../../store/actions/linkActions';


class SignedInLinks extends Component {
  constructor(props) {
    super(props);
    this.state = {
      success: true
    }
  }

  handleClick = () => {
    this.setState({
      ...this.state,
      success: false
    })
    this.props.outLink(this.state);
  }

  render() {
    return (
      <ul className="right">
        <li><NavLink to='/addRpi'>RPI Settings</NavLink></li>
        <li><NavLink to='/' onClick={this.handleClick} >Log Out</NavLink></li>
        <li><NavLink to='/dashboard' className='btn btn-floating blue lighten-1 '>AD</NavLink></li>
      </ul>
    )
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    outLink: (result) => {
      dispatch(outLink(result)) 
    }
  }
}

const mapStateToProps = (state) => {
  return {
    success: state.link.success
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(SignedInLinks);
